import styled from "styled-components";

export const Partners = styled.div`
font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
color : #eee;
padding: 100px 0;
height: 1000px;
background:#200752;
display: flex;
flex-direction: column;
justify-content: center;
align-items: center;

@media screen and (max-width: 768px){
    height: 1500px;
}

